script: |
  super -f text -I q8326.spq | sort > q8326.out

inputs:
  - name: q8326.spq
    data: |
      SELECT ALL + 20 * - - 46 * - - col1 AS col0, col1 * - col1 / - col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q8326.out
    data: |
      19320	21
      74520	81
      920	1
